import { Redirect, Route, Switch } from 'react-router-dom'
import CheckCookie from "./checkCookie.js"

import Access from "/home/ubuntu/dev/src/pages/access/js/Access.js"

export default function CustomRoutes() {

  const [cookieFound, setCookieFound] = useState( false )

  // Start execution on component mount
  useEffect( () => {
    const promise = new Promise( ( _resolve ) => {
      CheckCookie()
    } ).then( res => {
      res && setCookieFound( true )
    } )
  }, [] )

  return (
    <Switch>
      <Route exact path="/">
        {
          cookieFound ?
            () => {
              return <Redirect to="/frontpage" />
            } :
            <Access />
        }
      </Route>
    </Switch>
  )
}
